    function productList($client, $session, $type)
    {
        try {
            $result = $client->call($session, 'catalog_product.list');
        } Catch (\SoapFault $e) {
            return [];
        } Catch (Exception $e) {
            return [];
        }
        return $result;
    }

    function productImage($client, $session, $sku, $type)
    {
        try {
            $result = $client->call($session, 'catalog_product_attribute_media.list', $sku);
        } Catch (\SoapFault $e) {
            return [];
        } Catch (Exception $e) {
            return [];
        }
        return $result;
    }



